import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

const API_BASE_URL = 'http://localhost:5074/api';

const Home = () => {
  return <h1>Welcome to Advisor Client!</h1>;
};

const App = () => {
  const [advisors, setAdvisors] = useState([]);
  const [formData, setFormData] = useState({
    id: '',
    name: '',
    sin: '',
    address: '',
    phone: '',
  });
  const [isEditMode, setIsEditMode] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (isEditMode) {
        await axios.put(`${API_BASE_URL}/advisors/${formData.id}`, formData);
        setIsEditMode(false);
      } else {
        await axios.post(`${API_BASE_URL}/advisors`, formData);
      }
      setFormData({
        id: '',
        name: '',
        sin: '',
        address: '',
        phone: '',
      });
      fetchAdvisors();
    } catch (error) {
      console.error('Error adding/editing advisor:', error);
    }
  };

  const handleDelete = async (id) => {
    const confirmDelete = window.confirm('Are you sure you want to delete this advisor?');
    if (confirmDelete) {
      try {
        await axios.delete(`${API_BASE_URL}/advisors/${id}`);
        fetchAdvisors();
      } catch (error) {
        console.error('Error deleting advisor:', error);
      }
    }
  };

  const handleEdit = (advisor) => {
    const confirmEdit = window.confirm('Are you sure you want to edit this advisor?');
    if (confirmEdit) {
      setIsEditMode(true);
      setFormData({
        id: advisor.id,
        name: advisor.name,
        sin: advisor.sin,
        address: advisor.address,
        phone: advisor.phone,
      });
    }
  };

  const fetchAdvisors = async () => {
    try {
      const response = await axios.get(`${API_BASE_URL}/advisors`);
      setAdvisors(response.data);
    } catch (error) {
      console.error('Error fetching advisors:', error);
    }
  };

  useEffect(() => {
    fetchAdvisors();
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>

      <div className="container mt-4">
        <h2>{isEditMode ? 'Edit Advisor' : 'Add New Advisor'}</h2>
        <form onSubmit={handleSubmit}>
          {/* Form input fields */}
        </form>

        {advisors.length > 0 && (
          <div className="mt-4">
            <h2>Advisors List</h2>
            <div className="table-responsive">
              <table className="table table-striped">
                <thead>
                  {/* Table header */}
                </thead>
                <tbody>
                  {advisors.map((advisor) => (
                    <tr key={advisor.id}>
                      <td>{advisor.name}</td>
                      <td>{advisor.sin}</td>
                      <td>{advisor.address}</td>
                      <td>{advisor.phone}</td>
                      <td>
                        <button
                          onClick={() => handleEdit(advisor)}
                          className="btn btn-primary me-2"
                        >
                          Edit
                        </button>
                        <button
                          onClick={() => handleDelete(advisor.id)}
                          className="btn btn-danger"
                        >
                          Delete
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}
      </div>
    </Router>
  );
};

export default App;
